import React, { Component } from "react";

class SidebarButton extends Component {
  state = {
    imgSrc:
      "C:UsersAlvesDocumentsGitHubkinvo-front-end-testkinvo-testesrccomponentsimages/button-4-1.png",
    name: "Sem Nome",
    active: true
  };
  render() {
    return (
      <div>
        <img src={this.state.imgSrc} />
        <p>{this.state.name}</p>
      </div>
    );
  }
}

export default SidebarButton;
